import React from 'react';
import { dummyProfile } from '../data/dummyData';

const PersonalInfo = () => {
  const menuItems = [
    'Personal Information',
    'My Wallet',
    'My Following',
    'Task History',
    'Ratings and Feedback',
    'Task Analysis & Reports',
    'Security Settings',
    'Contact Customer Support'
  ];

  return (
    <div style={{ padding: '20px', color: 'white' }}>
      <div style={{ 
        backgroundColor: '#FF0000',
        color: 'white',
        padding: '10px',
        marginBottom: '20px',
        borderRadius: '5px',
        fontSize: '14px'
      }}>
        ⚠️ DEMO ONLY: This is a UI demonstration with pre-defined dummy data.
      </div>

      {menuItems.map((item, index) => (
        <div
          key={index}
          style={{
            backgroundColor: '#222',
            padding: '15px',
            marginBottom: '10px',
            borderRadius: '10px',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
          }}
        >
          <span>{item}</span>
          <span>›</span>
        </div>
      ))}
    </div>
  );
};

export default PersonalInfo;
